   [90]={next_id=91, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="但他们没能逃脱深渊的阴霾，向前数两个恒星年的时间，劳格一家外出旅行，乘坐的轿车被一辆大型运输车撞到，父母不幸罹难，她本人在医院中休养了很久。", msg_color="", msg_size=0, talker="渡鸦", audio="", img="arts/ui/bg/story/storybg_211.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4103", 0, 0, -45.5, 211}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [91]={next_id=92, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="这位不幸的小姐同时还失去了她引以为傲的容貌，在养伤和恢复期间，利瑟·克里安卡·劳格选择整容，决定专心整理父母遗留的作品和文件，并将家族财富全部交给了信托打理，从此潜入暗夜，难觅踪迹。", msg_color="", msg_size=0, talker="渡鸦", audio="", img="arts/ui/bg/story/storybg_211.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4103", 0, 0, -45.5, 211}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
