   [95]={next_id=96, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="不愧是和我共行深渊之人，能够立刻领会我的意思，由于老板及时的洞察，我们得知她曾经说过这么一番话——", msg_color="", msg_size=0, talker="渡鸦", audio="", img="arts/ui/bg/story/storybg_211.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4103", 0, 0, -45.5, 211}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
